const body = document.querySelector('body');
const cart = document.querySelector('.cart > a');

const renderCard = (product) => {
    const card = document.createElement('div');
    card.className = 'card';
    card.id = `${product.id}`;
    card.addEventListener('click', function (e) {
        if (!e.target.classList.contains('btn')) {
            const infoPizza = document.createElement('div');
            const h5 = document.createElement('h5');
            h5.className = 'title';
            h5.innerText = product.name;
            infoPizza.appendChild(h5);

            // p
            const p = document.createElement('p');
            p.innerText = product.composition.join(', ');
            infoPizza.appendChild(p);
            // span
            const span = document.createElement('span');
            span.className = 'caloricity';
            span.innerText = `${product.caloricity} Cal.`;
            infoPizza.appendChild(span);
            renderModal(infoPizza);
        }
    });

    const visual = document.createElement('div');
    visual.className = 'visual';
    card.appendChild(visual);

    // img
    const img = document.createElement('img');
    img.src = `images/${product.id}.jpg`;
    img.alt = 'image description';
    visual.appendChild(img);

    // holder text
    const text = document.createElement('div');
    text.className = 'text';
    card.appendChild(text);

    // h5
    const h5 = document.createElement('h5');
    h5.className = 'title';
    h5.innerText = product.name;
    text.appendChild(h5);

    // p
    const p = document.createElement('p');
    p.innerText = product.composition.join(', ');
    text.appendChild(p);
    // span
    const span = document.createElement('span');
    span.className = 'caloricity';
    span.innerText = `${product.caloricity} Cal.`;
    text.appendChild(span);
    // price
    const price = document.createElement('strong');
    price.className = 'price';
    price.innerText = `${product.price} грн.`;
    text.appendChild(price);

    // on hover cover
    const coverOnHover = document.createElement('div');
    coverOnHover.className = 'on-hover';
    text.appendChild(coverOnHover);

    // buttons
    const button = document.createElement('button');
    button.className = 'btn btn-info';
    button.innerText = 'заказать';
    button.onclick = function(e) {
        const cardProduct = this.closest(".card");
        // console.log(product)
        cartStore.putProducts(product);
    };
    coverOnHover.appendChild(button);
    getHeight();
    return card;
};

class Products {
    render() {
        const main = document.querySelector('main');
        main.className = 'd-flex';
        main.innerHTML = "";

        //aside
        const aside = document.createElement('aside');
        main.prepend(aside);

        // section
        const section = document.createElement('section');
        section.className = 'section-products py-3 w-100';
        main.appendChild(section);

        // container
        const container = document.createElement('div');
        container.className = 'container-fluid';
        section.appendChild(container);

        // row
        const row = document.createElement('div');
        row.className = 'row';
        // row.innerHTML = catalogPizzas;
        container.appendChild(row);

        let catalogPizzas = document.querySelector("section .container-fluid > .row");
        catalogPizzas.innerHTML = '';

        pizzaList.forEach((product) => {
            const card = renderCard(product);
            const col = document.createElement('div');
            col.className = 'col-md-6 col-lg-4 col-xl-3';
            row.appendChild(col);
            col.appendChild(card);
        });
    }
}

const renderModal = (content) => {
    let modal = document.createElement("div");
    modal.className = "modal-content";
    modal.appendChild(content);

    const close = document.createElement("span");
    close.className = "close";
    close.innerHTML = '<i class="icon-close"></i>';
    modal.appendChild(close);

    const overlay = document.createElement("div");
    overlay.className = "modal-overlay";
    overlay.appendChild(modal);

    document.body.appendChild(overlay);
    document.body.classList.add("open-modal");

    let overlayOfModal = document.querySelector('.modal-overlay');
    overlayOfModal.addEventListener('click', function (e) {
        if (e.target.className === 'modal-overlay' || e.target.className ===  'icon-close') {
            this.style.display = 'none';
            this.remove();
            body.classList.remove('open-modal');
        }
    });

    return modal;
};

let renderWishList = () => {
    const listWrap = document.createElement("div");
    listWrap.className = 'content-list';

    const title = document.createElement("h4");
    title.innerText = "Выбранные пиццы";
    listWrap.appendChild(title);

    const contentCart = document.createElement("div");

    contentCart.innerHTML = '';
    listWrap.appendChild(contentCart);

    contentCart.innerHTML =  order.render();


    return listWrap;
};

class Order {
    render() {
        const listStorage = cartStore.getProducts();
        let listItem = '';
        pizzaList.forEach((pizza) => {
            listStorage.forEach((item) => {
                if (item === pizza) {
                    listItem += `
                    <li>
                        <img width='32' height='32' src="data:image/png;base64,">
                        <span>${pizza.name}</span>
                        <span class='item-price'>${pizza.price.toLocaleString()} грн.</span>
                    </li>
                    
                `;
                }
            });

        });

        const list = `
            <ul class="order-list">${listItem}</ul>
        `;
        return list;

    }
}

const order = new Order();

const p = new Products();
p.render();
